import React,{ useState } from 'react';
import Selecteditem from './SelectedItem';

function SelectedNumList(props) {
  return (
    <div className="App">
        <h3>Selected Numbers</h3>
        <h2>selections {props.numbers}</h2>
        
    
    </div>
  );
}

export default SelectedNumList;
